import React, { useState, useEffect } from "react";
// import "./Styles.css";

function Contact() {
  useEffect(() => {
    fetching();
  }, []);
  const [data, setData] = useState([]);
  const fetching = (async) => {
    fetch("https://rapidapi.p.rapidapi.com/getStaticMap", {
      method: "POST",
      headers: {
        "x-rapidapi-key": "bd538a0cbfmshd5d6b51c7ced8d9p1b1e48jsn623334bcb300",
        "x-rapidapi-host": "YandexStaticraygorodskijV1.p.rapidapi.com",
      },
    })
      .then((response) => {
        console.log(response);
        setData(response);
      })
      .catch((err) => {
        console.error(err);
      });
  };
  return (
    <div className="centered">
      <h2>Contact and Map</h2>
      <iframe className="mapContent" src={data}></iframe>
    </div>
  );
}

export default Contact;
